import React, { Component } from 'react';
import { DetailWrapper, Header } from './style';

class Detail extends Component {
  render() { 
    return (
      <DetailWrapper>
        <Header>Sydney lockdown extended with more restrictions</Header>
      </DetailWrapper>
    );
  }
}

export default Detail;
